import React, { Component } from 'react';



class HeaderSub extends Component {

	render(){
		return(
			<nav class="navbar navbar-dark bg-dark">
				<span class="navbar-text">
					SHOPMATE
				</span>
				<span class="navbar-text">
					<span>Women</span>
					<span>Men</span>
					<span>Kids</span>
					<span>Shoes</span>
					<span>Brands</span>
				</span>

			</nav>
		);
	}
}





export default HeaderSub;
